(170, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:45:\"Introducing Elementor\'s Monthly Template Kits\";s:7:\"excerpt\";s:98:\"We\'re excited to declare we have just released the first in Elementor\'s Monthly Template Kits! ​\";s:7:\"created\";s:10:\"1564662570\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:121:\"https://elementor.com/blog/monthly-template-kits/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:64:\"Monday Masterclass: Building a One-Page Website With Hello Theme\";s:7:\"excerpt\";s:231:\"This week we’re demonstrating how simple and efficient it is to work with Hello Theme together with the Elementor Theme builder. To do this, we’ll create a one-page website, complete with a navigation menu in the header/footer.\";s:7:\"created\";s:10:\"1564394005\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/build-one-page-website/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:64:\"Introducing Custom Icons: Upload Unlimited Tailor-Made Icon Sets\";s:7:\"excerpt\";s:160:\"Elementor Pro version 2.6 gives you the power to upload your own custom icon libraries, integrate to Font Awesome 5 Pro, add exit animations to popups and more.\";s:7:\"created\";s:10:\"1563877391\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:124:\"https://elementor.com/blog/introducing-custom-icons/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
