(41, 25, 'abt_list', 'a:3:{i:0;a:4:{s:5:\"title\";s:11:\"What we are\";s:8:\"top_text\";s:17:\"Anything about us\";s:8:\"abl_icon\";s:10:\"fa-diamond\";s:15:\"abl_bottom_text\";s:180:\"A team of scientists aboard the International Space Station discover a rapidly evolving life form, that caused extinction on Mars, and now threatens the crew and all life on Earth.\";}i:1;a:4:{s:5:\"title\";s:12:\"Why we do it\";s:8:\"top_text\";s:17:\"The reason behind\";s:8:\"abl_icon\";s:7:\"fa-cube\";s:15:\"abl_bottom_text\";s:183:\"Blindsided by a new generation of blazing-fast racers, when she is assigned to clean up the K9 unit after a disciplinary hearing, Leavey identifies with a particularly aggressive dog.\";}i:2;a:4:{s:5:\"title\";s:12:\"How we do it\";s:8:\"top_text\";s:16:\"The way of works\";s:8:\"abl_icon\";s:7:\"fa-bell\";s:15:\"abl_bottom_text\";s:175:\"To get back in the game, he will need the help of an eager young race technician with her own plan to win, inspiration from the late Hudson Hornet, and a few unexpected turns.\";}}'),
