(413, 132, '_elementor_data', '[{\"id\":\"5630e1da\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"121034c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"space_between_widgets\":0},\"elements\":[{\"id\":\"e3bce96\",\"elType\":\"widget\",\"settings\":{\"title\":\"Services\",\"title_color\":\"#e04a2c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Rubik\",\"typography_font_size\":{\"unit\":\"px\",\"size\":50},\"typography_line_height\":{\"unit\":\"px\",\"size\":\"\"}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"b941cb6\",\"elType\":\"widget\",\"settings\":{\"color\":\"rgba(0,0,0,0.19)\",\"align\":\"center\"},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"08d13ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"https:\\/\\/griyapsikologi.com\\/wp-content\\/uploads\\/2019\\/05\\/WhatsApp-Image-2019-04-21-at-17.28.27-e1565429733582.jpeg\",\"id\":190},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"3fae3480\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><!-- wp:heading --><\\/p>\\n<h2>Psikotest dan Seleksi<\\/h2>\\n<p><!-- \\/wp:heading --><\\/p>\\n<p><!-- wp:paragraph --><\\/p>\\n<p>Tes Psikologi digunakan untuk mengungkap aspek psikologis yang bersifat potensi setiap individu seperti kepribadian dan intelegensi. Tes Psikologi atau Psikotes adalah bidang yang ditandai dengan penggunaan sampel perilaku untuk menilai konstruksi psikologis seperti fungsi kognitif dan emosional. Psikotes merupakan pemeriksaan psikologis dengan menggunakan serangkaian alat tes, tes dapat berbentuk tertulis, visual, atau evaluasi secara verbal yang teradministrasi.<\\/p>\\n<p><!-- \\/wp:paragraph --><\\/p>\\n<p><!-- wp:paragraph --><\\/p>\\n<p>Melalui psikotes akan diungkap potensi yang dimiliki oleh setiap individu, psikotest dapat dilakukan secara mandiri untuk mengetahui gambaran potensi seseorang individu,\\u00a0 sering juga dilakukan untuk penjurusan di sekolah menengah ataupun seleksi siswa \\/ mahasiswa \\/ taruna dibidang pendidikan. Psikotest juga kerap dilakukan dalam bidang lain seperti dalam bidang klinis dan industri untuk membantu mengungkap aspek psikologis yang dinginkan. Aspek seperti leadership dan ketelitian seringkali dibutuhkan diungkap terlebih dahulu sebelum seorang karyawan diterima dalam bidang industri, psikotest sangat dibutuhkan untuk mengungkap aspek-aspek tersebut dan proses rekrutmen akan menguatkan aspek-aspek yang muncul dalam rekrutmen karyawan dan termewujudlah \\u201cThe Right Man in The Right Place\\u201d.<\\/p>\\n<p><!-- \\/wp:paragraph --><\\/p>\\n<p><!-- wp:paragraph --><\\/p>\\n<p>Organisasi harus mampu memilih talent yang tepat untuk menjalankan strategi bisnis tersebut. Proses rekrutmen menjadi sangat penting untuk diperhatikan. Recruitment membantu organisasi melakukan untuk mendapatkan talent yang tepat dari sisi kompetensi teknikal, perilaku, aspirasi, dan potensi sehingga ia dapat bekerja secara efektif dan inovatif yang berujung pada pencapaian kinerja yang diharapkan organisasi.<\\/p>\\n<p><!-- \\/wp:paragraph --><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"42c71fb\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h2>Konseling dan Psikoterapi<\\/h2>\\n<p>Lembaga Psikologi dan Psikometri RSF menyediakan layanan konsultasi Psikologi dan Konselor, baik berupa bimbingan yang diberikan agar mampu mengembangkan potensi secara optimal dengan memahami dirinya sendiri, atau berupa konseling dengan menyediakan situasi belajar dan juga memberi dukungan terhadap krisis yang bermuara pada pemecahan masalah.<\\/p>\\n<p>Layanan konsultasi Psikologi dan Konselor juga dapat berupa Psikoterapi, Psikoterapis akan memberikan terapi pada masalah yang berkaitan dengan pikiran, perasaan dan perilaku<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"ce1dd8c\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h2 class=\\\"MsoNormal\\\">Outbound dan Training<\\/h2>\\n<p>Outbound dan Training adalah metode pelatihan untuk meningkatkan performa individu maupun kelompok melalui pembelajaran dan pengalaman. Program-program yang diadakan seringkali mengacu kepada pelatihan melalui petualangan dan permainan (games) diaalam terbuka.<\\/p>\\n<p>Outbound merupakan sarana penambah wawasan pengetahuan yang didapat dari serangkaian pengalaman berpetualang sehingga dapat memacu semangat dan kreativitas seseorang. Fokus dalam pelatihan adalah untuk mengoptimalkan potensi dalam diri manusia melalui experiental learning dengan metode simulasi, role play, focus group discussion, fun game, story telling, dan dengan metode kombinasi.<\\/p>\\n<p>Pendidikan yang bertujuan untuk mengubah kognitif, afektif, dan psikomotorik seseorang tentunya memerlukan proses yang lama, namun dengan pelatihan menggunakan prinsip andragogi maupun prinsip pedagogik maka proses pencapaian tujuan pendidikan tadi bisa dipercepat, pengalaman yang didapatkan adalah guru dalam proses pembelajaran secara alami. Agar tujuan Outbond dan Training dapat tepat sasaran kami merancang program dengan beberahapa tahapan:<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"d532098\",\"elType\":\"widget\",\"settings\":{\"view\":\"inline\",\"icon_list\":[{\"text\":\"Training Need Analysis\",\"icon\":\"fa fa-dot-circle-o\",\"_id\":\"1cb5c60\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"}},{\"text\":\"Penetapan Kebutuhan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"9c0eeae\"},{\"text\":\"Pembuatan Modul Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"2f2cdbc\"},{\"text\":\"Pelaksanaan Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"3c8a61c\"},{\"text\":\"Laporan Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"03e69ff\"},{\"text\":\"Follow Up\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"15dc64a\"}],\"icon_color\":\"#54595f\"},\"elements\":[],\"widgetType\":\"icon-list\"},{\"id\":\"e1a2297\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Aktifitas yang disajikan dalam outbound atau pelatihan memang telah disusun sedemikian rupa, sehingga bukan hanya psikomotorik (fisik) peserta saja yang beraktifitas tapi juga afeksi (emosi) dan kognisi (kemampuan berpikir) turut serta dalam rangkaian kegiatan Outbond dan Training.<\\/p>\\n<p>Prinsip pelatihan ini memungkinkan peserta dapat memaksimalkan potensinya, karena peserta akan belajar melakukan perjalanan <em>Inner Journey<\\/em> dalam dirinya. Perjalanan <em>Inner Journey<\\/em> ini memungkinkan peserta menemukan potensi dan motivasi internalnya. Pada akhirnya menjadikan peserta percaya pada adanya Tuhan (Believe in God), selalu semangat untuk belajar (Eager to Learn), punya ketulusan dalam segala hal (Sincerely), dan saling bersinergi dalam bekerja sama dengan orang lain (Toward together). \\u00a0\\u00a0\\u00a0\\u00a0\\u00a0<\\/p>\\n<p>Tujuan pelatihan pada umumnya berkisar pada aktifitas atau kegiatan yang di-design untuk meningkatkan aspek-aspek seperti : leadership, communication skills, planning, change management, delegation, teamwork, motivation dll. Dalam memberikan outbound dan training kami mengukur tingkat keefektifannya dengan memadukan suatu modul design dengan pre-test dan post-test (pelatihan terukur).\\u00a0 Kami juga memberikan fun games sebagai out bound dan training yang bersifat sebagai refreshing atau remotivasi.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"18a64ec\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"829f23c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false}]'),
