(418, 140, '_elementor_data', '[{\"id\":\"5630e1da\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"121034c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"e3bce96\",\"elType\":\"widget\",\"settings\":{\"title\":\"Services\",\"size\":\"xl\",\"title_color\":\"#0c0c0c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Rubik\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"08d13ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"https:\\/\\/griyapsikologi.com\\/wp-content\\/uploads\\/2017\\/06\\/work8.jpg\",\"id\":37},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"3fae3480\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:heading -->\\n<h2>Psikotest dan Recruitment<\\/h2>\\n<!-- \\/wp:heading -->\\n\\n<!-- wp:paragraph -->\\n<p>Tes Psikologi digunakan untuk mengungkap aspek psikologis yang bersifat potensi setiap individu seperti kepribadian dan intelegensi. Tes Psikologi atau Psikotes adalah bidang yang ditandai dengan penggunaan sampel perilaku untuk menilai konstruksi psikologis seperti fungsi kognitif dan emosional. Psikotes merupakan pemeriksaan psikologis dengan menggunakan serangkaian alat tes, tes dapat berbentuk tertulis, visual, atau evaluasi secara verbal yang teradministrasi.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:paragraph -->\\n<p>Melalui psikotes akan diungkap potensi yang dimiliki oleh setiap individu, psikotest dapat dilakukan secara mandiri untuk mengetahui gambaran potensi seseorang individu,\\u00a0 sering juga dilakukan untuk penjurusan di sekolah menengah ataupun seleksi siswa \\/ mahasiswa \\/ taruna dibidang pendidikan. Psikotest juga kerap dilakukan dalam bidang lain seperti dalam bidang klinis dan industri untuk membantu mengungkap aspek psikologis yang dinginkan. Aspek seperti leadership dan ketelitian seringkali dibutuhkan diungkap terlebih dahulu sebelum seorang karyawan diterima dalam bidang industri, psikotest sangat dibutuhkan untuk mengungkap aspek-aspek tersebut dan proses rekrutmen akan menguatkan aspek-aspek yang muncul dalam rekrutmen karyawan dan termewujudlah \\u201cThe Right Man in The Right Place\\u201d.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:paragraph -->\\n<p>Organisasi harus mampu memilih talent yang tepat untuk menjalankan strategi bisnis tersebut. Proses rekrutmen menjadi sangat penting untuk diperhatikan. Recruitment membantu organisasi melakukan untuk mendapatkan talent yang tepat dari sisi kompetensi teknikal, perilaku, aspirasi, dan potensi sehingga ia dapat bekerja secara efektif dan inovatif yang berujung pada pencapaian kinerja yang diharapkan organisasi.<\\/p>\\n<!-- \\/wp:paragraph -->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"18a64ec\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"829f23c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"42c71fb\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h2>Rumah Konseling dan Psikoterapi<\\/h2>\\n<p>Rumah Konseling dan Psikoterapi menyediakan layanan konsultasi Psikologi dan Konselor, baik berupa bimbingan yang diberikan agar mampu mengembangkan potensi secara optimal dengan memahami dirinya sendiri, atau berupa konseling dengan menyediakan situasi belajar dan juga memberi dukungan terhadap krisis yang bermuara pada pemecahan masalah.<\\/p>\\n<p>Layanan konsultasi Psikologi dan Konselor juga dapat berupa Psikoterapi, Psikoterapis akan memberikan terapi pada masalah yang berkaitan dengan pikiran, perasaan dan perilaku.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
