 pembelajaran dan pengalaman. Program-program yang diadakan seringkali mengacu kepada pelatihan melalui petualangan dan permainan (games) diaalam terbuka.<\\/p>\\n<p>Outbound merupakan sarana penambah wawasan pengetahuan yang didapat dari serangkaian pengalaman berpetualang sehingga dapat memacu semangat dan kreativitas seseorang. Fokus dalam pelatihan adalah untuk mengoptimalkan potensi dalam diri manusia melalui experiental learning dengan metode simulasi, role play, focus group discussion, fun game, story telling, dan dengan metode kombinasi.<\\/p>\\n<p>Pendidikan yang bertujuan untuk mengubah kognitif, afektif, dan psikomotorik seseorang tentunya memerlukan proses yang lama, namun dengan pelatihan menggunakan prinsip andragogi maupun prinsip pedagogik maka proses pencapaian tujuan pendidikan tadi bisa dipercepat, pengalaman yang didapatkan adalah guru dalam proses pembelajaran secara alami. Agar tujuan Outbond dan Training dapat tepat sasaran kami merancang program dengan beberahapa tahapan:<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"d532098\",\"elType\":\"widget\",\"settings\":{\"view\":\"inline\",\"icon_list\":[{\"text\":\"Training Need Analysis\",\"icon\":\"fa fa-dot-circle-o\",\"_id\":\"1cb5c60\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"}},{\"text\":\"Penetapan Kebutuhan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"9c0eeae\"},{\"text\":\"Pembuatan Modul Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"2f2cdbc\"},{\"text\":\"Pelaksanaan Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"3c8a61c\"},{\"text\":\"Laporan Pelatihan\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"03e69ff\"},{\"text\":\"Follow Up\",\"icon\":\"fa fa-chevron-right\",\"link\":{\"url\":\"\",\"is_external\":\"\",\"nofollow\":\"\"},\"_id\":\"15dc64a\"}],\"icon_color\":\"#54595f\"},\"elements\":[],\"widgetType\":\"icon-list\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"18a64ec\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"829f23c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false}]'),
