(433, 143, '_elementor_data', '[{\"id\":\"5630e1da\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"121034c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"space_between_widgets\":0},\"elements\":[{\"id\":\"e3bce96\",\"elType\":\"widget\",\"settings\":{\"title\":\"Services\",\"title_color\":\"#e04a2c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Rubik\",\"typography_font_size\":{\"unit\":\"px\",\"size\":50},\"typography_line_height\":{\"unit\":\"px\",\"size\":\"\"}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"b941cb6\",\"elType\":\"widget\",\"settings\":{\"color\":\"rgba(0,0,0,0.19)\",\"align\":\"center\"},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"08d13ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"https:\\/\\/griyapsikologi.com\\/wp-content\\/uploads\\/2017\\/06\\/work8.jpg\",\"id\":37},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"3fae3480\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:heading -->\\n<h2>Psikotest dan Recruitment<\\/h2>\\n<!-- \\/wp:heading -->\\n\\n<!-- wp:paragraph -->\\n<p>Tes Psikologi digunakan untuk mengungkap aspek psikologis yang bersifat potensi setiap individu seperti kepribadian dan intelegensi. Tes Psikologi atau Psikotes adalah bidang yang ditandai dengan penggunaan sampel perilaku untuk menilai konstruksi psikologis seperti fungsi kognitif dan emosional. Psikotes merupakan pemeriksaan psikologis dengan menggunakan serangkaian alat tes, tes dapat berbentuk tertulis, visual, atau evaluasi secara verbal yang teradministrasi.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:paragraph -->\\n<p>Melalui psikotes akan diungkap potensi yang dimiliki oleh setiap individu, psikotest dapat dilakukan secara mandiri untuk mengetahui gambaran potensi seseorang individu,\\u00a0 sering juga dilakukan untuk penjurusan di sekolah menengah ataupun seleksi siswa \\/ mahasiswa \\/ taruna dibidang pendidikan. Psikotest juga