(7, 1, '2018-12-21 00:06:47', '2018-12-21 00:06:47', '<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nRSF \"[your-subject]\"\nRSF <admin@griyapsikologi.com>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on RSF (https://griyapsikologi.com)\nadmin@griyapsikologi.com\nReply-To: [your-email]\n\n0\n0\n\nRSF \"[your-subject]\"\nRSF <admin@griyapsikologi.com>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on RSF (https://griyapsikologi.com)\n[your-email]\nReply-To: admin@griyapsikologi.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-12-21 00:06:47', '2018-12-21 00:06:47', '', 0, 'https://griyapsikologi.com/?post_type=wpcf7_contact_form&p=7', 0, 'wpcf7_contact_form', '', 0),
