(25, 1, '2017-06-30 23:06:03', '2017-06-30 23:06:03', 'A headhunter whose life revolves around closing deals in a a survival-of-the-fittest boiler room, battles his top rival for control of their job placement company — his dream of owning the company clashing with the needs of his family.\n\nOn the run after the New Gods’ show of force, Shadow and Mr. Wednesday seek safe haven with one of Mr. Wednesday’s oldest friends, Vulcan, God of the Fire and the Forge.', 'The happiness of a man in this life does not consist in the absence but in the mastery of his passions.', '', 'publish', 'closed', 'closed', '', 'the-happiness-of-a-man-in-this-life-does-not-consist-in-the-absence-but-in-the-mastery-of-his-passions', '', '', '2017-06-30 23:06:03', '2017-06-30 23:06:03', '', 0, 'http://theme.ridianur.com/benten/?post_type=about-us&amp;p=25', 0, 'about-us', '', 0),
