(50, 1, '2017-06-30 23:31:17', '2017-06-30 23:31:17', 'After the disappearance of a young scientist on a business trip, his son and wife struggle to cope, only to make a bizarre discovery years later one that may bring him home. Ali is chief of the homicide branch of the South African police in Cape Town. One of his staff is Brian Epkeen, a free-wheeling white officer whose family.\n\nFresh from prison, a street racer who was framed by a wealthy business associate joins a cross country race with revenge in mind. His ex-partner, learning of the plan, places a massive bounty on his head as the race begins. An incorrigibly self-serving exiled squirrel finds himself helping his former park brethren raid a nut store to survive, that is also the front for a human gang’s bank robbery. A rebel girl signs up a group of cheerleaders to help her take down the captain of their high school football team, but a supernatural turn of events thrusts the girls into a different battle they return to Sheffield for their last UK concert.', 'The Savior', '', 'draft', 'open', 'closed', '', 'the-savior', '', '', '2019-05-06 04:18:25', '2019-05-06 04:18:25', '', 0, 'http://theme.ridianur.com/benten/?post_type=portfolio&#038;p=50', 0, 'portfolio', '', 0),
(52, 1, '2017-06-30 23:45:30', '2017-06-30 23:45:30', 'Now that Dom and Letty are on their honeymoon and Brian and Mia have retired from the game-and the rest of the crew has been exonerated-the globetrotting team has found a semblance of a normal life. But when a mysterious woman seduces Dom into the world of crime he can’t seem to escape and a betrayal of those closest to him, they will face trials that will test them as never before.\n\nFrom the shores of Cuba and the streets of New York City to the icy plains off the arctic Barents Sea, the elite force will crisscross the globe to stop an anarchist from unleashing chaos on the world’s stage… and to bring home the man who made them a family.\n\nWhen the moral values of a longtime wetwork black ops agent is tested during his last operation, he receives an unfavorable psych evaluation. Now he is given a break assignment.\n\nWhen unlucky Max is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life but could bring equality to these polarized worlds.', 'Will not only save his life but could bring equality to these polarized worlds', '', 'publish', 'open', 'open', '', 'will-not-only-save-his-life-but-could-bring-equality-to-these-polarized-worlds', '', '', '2017-06-30 23:45:30', '2017-06-30 23:45:30', '', 0, 'http://theme.ridianur.com/benten/?p=52', 0, 'post', '', 0),
(103, 1, '2017-06-30 23:49:01', '2017-06-30 23:49:01', 'When unlucky Max is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life but could bring equality to these polarized worlds.\n\nNow that Dom and Letty are on their honeymoon and Brian and Mia have retired from the game-and the rest of the crew has been exonerated-the globetrotting team has found a semblance of a normal life. But when a mysterious woman seduces Dom into the world of crime he can’t seem to escape and a betrayal of those closest to him, they will face trials that will test them as never before.\n\nWhen the moral values of a longtime wetwork black ops agent is tested during his last operation, he receives an unfavorable psych evaluation. Now he is given a break assignment.\n\nFrom the shores of Cuba and the streets of New York City to the icy plains off the arctic Barents Sea, the elite force will crisscross the globe to stop an anarchist from unleashing chaos on the world’s stage… and to bring home the man who made them a family.', 'Hannah grapples with her Decision to Reveal', '', 'publish', 'open', 'open', '', 'hannah-grapples-with-her-decision-to-reveal', '', '', '2017-06-30 23:49:01', '2017-06-30 23:49:01', '', 0, 'http://theme.ridianur.com/benten/?p=60', 0, 'post', '', 0),
(104, 1, '2017-06-30 23:50:52', '2017-06-30 23:50:52', 'Though safely entombed in a crypt deep beneath the unforgiving desert, an ancient princess, whose destiny was unjustly taken from her, is awakened in our current day bringing with her malevolence grown over millennia, and terrors that defy human comprehension.\n\nTen years after the animals were cured but at the cost of sterilizing the human population, a new threat rises in the form of “the hybrids,” an army of unstoppable lab-made creatures focused on destroying mankind, on the third-season premiere.\n\nJuliette spars with Avery over Hallie’s sound. Maddie discovers the truth about the origins of the bullying on social media. Scarlett’s pregnancy garners her some unexpected attention.', 'Portuguese Jesuit priests Travel to Japan', '', 'publish', 'open', 'open', '', 'portuguese-jesuit-priests-travel-to-japan', '', '', '2017-06-30 23:50:52', '2017-06-30 23:50:52', '', 0, 'http://theme.ridianur.com/benten/?p=62', 0, 'post', '', 0),
(64, 1, '2017-06-30 23:52:08', '2017-06-30 23:52:08', 'When the moral values of a longtime wetwork black ops agent is tested during his last operation, he receives an unfavorable psych evaluation. Now he is given a break assignment.\n\nWhen unlucky Max is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life but could bring equality to these polarized worlds.', 'Five friends are Terrorized by an Entity', '', 'publish', 'open', 'open', '', 'five-friends-are-terrorized-by-an-entity', '', '', '2017-06-30 23:52:08', '2017-06-30 23:52:08', '', 0, 'http://theme.ridianur.com/benten/?p=64', 0, 'post', '', 0),
