(115, 1, '2019-01-15 15:17:29', '2019-01-15 15:17:29', 'A headhunter whose life revolves around closing deals in a a survival-of-the-fittest boiler room, battles his top rival for control of their job placement company — his dream of owning the company clashing with the needs of his family.\r\n\r\nOn the run after the New Gods’ show of force, Shadow and Mr. Wednesday seek safe haven with one of Mr. Wednesday’s oldest friends, Vulcan, God of the Fire and the Forge.', 'The happiness of a man in this life does not consist in the absence but in the mastery of his passions.', '', 'inherit', 'closed', 'closed', '', '25-autosave-v1', '', '', '2019-01-15 15:17:29', '2019-01-15 15:17:29', '', 25, 'https://griyapsikologi.com/2019/01/15/25-autosave-v1/', 0, 'revision', '', 0),
