aph -->', 'Services', '', 'inherit', 'closed', 'closed', '', '132-revision-v1', '', '', '2019-01-17 06:10:38', '2019-01-17 06:10:38', '', 132, 'https://griyapsikologi.com/2019/01/17/132-revision-v1/', 0, 'revision', '', 0),
