(142, 1, '2019-01-17 06:50:54', '2019-01-17 06:50:54', '<h2>Services</h2>		\n										<img width=\"768\" height=\"480\" src=\"https://griyapsikologi.com/wp-content/uploads/2017/06/work8-768x480.jpg\" alt=\"\" srcset=\"https://griyapsikologi.com/wp-content/uploads/2017/06/work8-768x480.jpg 768w, https://griyapsikologi.com/wp-content/uploads/2017/06/work8-300x188.jpg 300w, https://griyapsikologi.com/wp-content/uploads/2017/06/work8.jpg 800w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<!-- wp:heading -->\n<h2>Psikotest dan Recruitment</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p>Tes Psikologi digunakan untuk mengungkap aspek psikologis yang bersifat potensi setiap individu seperti kepribadian dan intelegensi. Tes Psikologi atau Psikotes adalah bidang yang ditandai dengan penggunaan sampel perilaku untuk menilai konstruksi psikologis seperti fungsi kognitif dan emosional. Psikotes merupakan pemeriksaan psikologis dengan menggunakan serangkaian alat tes, tes dapat berbentuk tertulis, visual, atau evaluasi secara verbal yang teradministrasi.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Melalui psikotes akan diungkap potensi yang dimiliki oleh setiap individu, psikotest dapat dilakukan secara mandiri untuk mengetahui gambaran potensi seseorang individu,  sering juga dilakukan untuk penjurusan di sekolah menengah ataupun seleksi siswa / mahasiswa / taruna dibidang pendidikan. Psikotest juga kerap dilakukan dalam bidang lain seperti dalam bidang klinis dan industri untuk membantu mengungkap aspek psikologis yang dinginkan. Aspek seperti leadership dan ketelitian seringkali dibutuhkan diungkap terlebih dahulu sebelum seorang karyawan diterima dalam bidang industri, psikotest sangat dibutuhkan untuk mengungkap aspek-aspek tersebut dan proses rekrutmen akan menguatkan aspek-aspek yang muncul dalam rekrutmen karyawan dan termewujudlah “The Right Man in The Right Place”.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Organisasi harus mampu memilih talent yang tepat untuk menjalankan strategi bisnis tersebut. Proses rekrutmen menjadi sangat penting untuk diperhatikan. Recruitment membantu organisasi melakukan untuk mendapatkan talent yang tepat dari sisi kompetensi teknikal, perilaku, aspirasi, dan potensi sehingga ia dapat bekerja secara efektif dan inovatif yang berujung pada pencapaian kinerja yang diharapkan organisasi.</p>\n<!-- /wp:paragraph --><h2>Rumah Konseling dan Psikoterapi</h2>\n<p>Rumah Konseling dan Psikoterapi menyediakan layanan konsultasi Psikologi dan Konselor, baik berupa bimbingan yang diberikan agar mampu mengembangkan potensi secara optimal dengan memahami dirinya sendiri, atau berupa konseling dengan menyediakan situasi belajar dan juga memberi dukungan terhadap krisis yang bermuara pada pemecahan masalah.</p>\n<p>Layanan konsultasi Psikologi dan Konselor juga dapat berupa Psikoterapi, Psikoterapis akan memberikan terapi pada masalah yang berkaitan dengan pikiran, perasaan dan perilaku.</p><h2>Outbound dan Training</h2>\n<p>Outbound dan Training adalah metode pelatihan untuk meningkatkan performa individu maupun kelompok melalui pembelajaran dan pengalaman. Program-program yang diadakan seringkali mengacu kepada pelatihan melalui petualangan dan permainan (games) diaalam terbuka.</p>\n<p>Outbound merupakan sarana penambah wawasan pengetahuan yang didapat dari serangkaian pengalaman berpetualang sehingga dapat memacu semangat dan kreativitas seseorang. Fokus dalam pelatihan adalah untuk mengoptimalkan potensi dalam diri manusia melalui experiental learning dengan metode simulasi, role play, focus group discussion, fun game, story telling, dan dengan metode kombinasi.</p>\n<p>Pendidikan yang bertujuan untuk mengubah kognitif, afektif, dan psikomotorik seseorang tentunya memerlukan proses yang lama, namun dengan pelatihan menggunakan prinsip andragogi maupun prinsip pedagogik maka proses pencapaian tujuan pendidikan tadi bisa dipercepat, pengalaman yang didapatkan adalah guru dalam proses pembelajaran secara alami. Agar tujuan Outbond dan Training dapat tepat sasaran kami merancang program dengan beberahapa tahapan:</p>		\n					<ul>\n							<li >\n										Training Need Analysis\n									</li>\n								<li >\n										Penetapan Kebutuhan\n									</li>\n								<li >\n										Pembuatan Modul Pelatihan\n									</li>\n								<li >\n										Pelaksanaan Pelatihan\n									</li>\n								<li >\n										Laporan Pelatihan\n									</li>\n								<li >\n										Follow Up\n									</li>\n						</ul>', 'Services', '', 'inherit', 'closed', 'closed', '', '132-revision-v1', '', '', '2019-01-17 06:50:54', '2019-01-17 06:50:54', '', 132, 'https://griyapsikologi.com/2019/01/17/132-revision-v1/', 0, 'revision', '', 0),
(143, 1, '2019-01-17 06:52:42', '2019-01-17 06:52:42', '<h2>Services</h2>		\n										<img width=\"768\" height=\"480\" src=\"https://griyapsikologi.com/wp-content/uploads/2017/06/work8-768x480.jpg\" alt=\"\" srcset=\"https://griyapsikologi.com/wp-content/uploads/2017/06/work8-768x480.jpg 768w, https://griyapsikologi.com/wp-content/uploads/2017/06/work8-300x188.jpg 300w, https://griyapsikologi.com/wp-content/uploads/2017/06/work8.jpg 800w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<!-- wp:heading -->\n<h2>Psikotest dan Recruitment</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p>Tes Psikologi digunakan untuk mengungkap aspek psikologis yang bersifat potensi setiap individu seperti kepribadian dan intelegensi. Tes Psikologi atau Psikotes adalah bidang yang ditandai dengan penggunaan sampel perilaku untuk menilai konstruksi psikologis seperti fungsi kognitif dan emosional. Psikotes merupakan pemeriksaan psikologis dengan menggunakan serangkaian alat tes, tes dapat berbentuk tertulis, visual, atau evaluasi secara verbal yang teradministrasi.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Melalui psikotes akan diungkap potensi yang dimiliki oleh setiap individu, psikotest dapat dilakukan secara mandiri untuk mengetahui gambaran potensi seseorang individu,  sering juga dilakukan untuk penjurusan di sekolah menengah ataupun seleksi siswa / mahasiswa / taruna dibidang pendidikan. Psikotest juga kerap dilakukan dalam bidang lain seperti dalam bidang klinis dan industri untuk membantu mengungkap aspek psikologis yang dinginkan. Aspek seperti leadership dan ketelitian seringkali dibutuhkan diungkap terlebih dahulu sebelum seorang karyawan diterima dalam bidang industri, psikotest sangat dibutuhkan untuk mengungkap aspek-aspek tersebut dan proses rekrutmen akan menguatkan aspek-aspek yang muncul dalam rekrutmen karyawan dan termewujudlah “The Right Man in The Right Place”.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Organisasi harus mampu memilih talent yang tepat untuk menjalankan strategi bisnis tersebut. Proses rekrutmen menjadi sangat penting untuk diperhatikan. Recruitment membantu organisasi melakukan untuk mendapatkan talent yang tepat dari sisi kompetensi teknikal, perilaku, aspirasi, dan potensi sehingga ia dapat bekerja secara efektif dan inovatif yang berujung pada pencapaian kinerja yang diharapkan organisasi.</p>\n<!-- /wp:paragraph --><h2>Rumah Konseling dan Psikoterapi</h2>\n<p>Rumah Konseling dan Psikoterapi menyediakan layanan konsultasi Psikologi dan Konselor, baik berupa bimbingan yang diberikan agar mampu mengembangkan potensi secara optimal dengan memahami dirinya sendiri, atau berupa konseling dengan menyediakan situasi belajar dan juga memberi dukungan terhadap krisis yang bermuara pada pemecahan masalah.</p>\n<p>Layanan konsultasi Psikologi dan Konselor juga dapat berupa Psikoterapi, Psikoterapis akan memberikan terapi pada masalah yang berkaitan dengan pikiran, perasaan dan perilaku.</p><h2>Outbound dan Training</h2>\n<p>Outbound dan Training adalah metode pelatihan untuk meningkatkan performa individu maupun kelompok melalui pembelajaran dan pengalaman. Program-program yang diadakan seringkali mengacu kepada pelatihan melalui petualangan dan permainan (games) diaalam terbuka.</p>\n<p>Outbound merupakan sarana penambah wawasan pengetahuan yang didapat dari serangkaian pengalaman berpetualang sehingga dapat memacu semangat dan kreativitas seseorang. Fokus dalam pelatihan adalah untuk mengoptimalkan potensi dalam diri manusia melalui experiental learning dengan metode simulasi, role play, focus group discussion, fun game, story telling, dan dengan metode kombinasi.</p>\n<p>Pendidikan yang bertujuan untuk mengubah kognitif, afektif, dan psikomotorik seseorang tentunya memerlukan proses yang lama, namun dengan pelatihan menggunakan prinsip andragogi maupun prinsip pedagogik maka proses pencapaian tujuan pendidikan tadi bisa dipercepat, pengalaman yang didapatkan adalah guru dalam proses pembelajaran secara alami. Agar tujuan Outbond dan Training dapat tepat sasaran kami merancang program dengan beberahapa tahapan:</p>		\n					<ul>\n							<li >\n										Training Need Analysis\n									</li>\n								<li >\n										Penetapan Kebutuhan\n									</li>\n								<li >\n										Pembuatan Modul Pelatihan\n									</li>\n								<li >\n										Pelaksanaan Pelatihan\n									</li>\n								<li >\n										Laporan Pelatihan\n									</li>\n								<li >\n										Follow Up\n									</li>\n						</ul>\n		<p>Aktifitas yang disajikan dalam outbound atau pelatihan memang telah disusun sedemikian rupa, sehingga bukan hanya psikomotorik (fisik) peserta saja yang beraktifitas tapi juga afeksi (emosi) dan kognisi (kemampuan berpikir) turut serta dalam rangkaian kegiatan Outbond dan Training.</p>\n<p>Prinsip pelatihan ini memungkinkan peserta dapat memaksimalkan potensinya, karena peserta akan belajar melakukan perjalanan <em>Inner Journey</em> dalam dirinya. Perjalanan <em>Inner Journey</em> ini memungkinkan peserta menemukan potensi dan motivasi internalnya. Pada akhirnya menjadikan peserta percaya pada adanya Tuhan (Believe in God), selalu semangat untuk belajar (Eager to Learn), punya ketulusan dalam segala hal (Sincerely), dan saling bersinergi dalam bekerja sama dengan orang lain (Toward together).      </p>\n<p>Tujuan pelatihan pada umumnya berkisar pada aktifitas atau kegiatan yang di-design untuk meningkatkan aspek-aspek seperti : leadership, communication skills, planning, change management, delegation, teamwork, motivation dll. Dalam memberikan outbound dan training kami mengukur tingkat keefektifannya dengan memadukan suatu modul design dengan pre-test dan post-test (pelatihan terukur).  Kami juga memberikan fun games sebagai out bound dan training yang bersifat sebagai refreshing atau remotivasi.</p>', 'Services', '', 'inherit', 'closed', 'closed', '', '132-revision-v1', '', '', '2019-01-17 06:52:42', '2019-01-17 06:52:42', '', 132, 'https://griyapsikologi.com/2019/01/17/132-revision-v1/', 0, 'revision', '', 0),
(144, 1, '2019-01-17 07:03:51', '2019-01-17 07:03:51', 'After the disappearance of a young scientist on a business trip, his son and wife struggle to cope, only to make a bizarre discovery years later one that may bring him home. Ali is chief of the homicide branch of the South African police in Cape Town. One of his staff is Brian Epkeen, a free-wheeling white officer whose family.\n\nFresh from prison, a street racer who was framed by a wealthy business associate joins a cross country race with revenge in mind. His ex-partner, learning of the plan, places a massive bounty on his head as the race begins. An incorrigibly self-serving exiled squirrel finds himself helping his former park brethren raid a nut store to survive, that is also the front for a human gang’s bank robbery. A rebel girl signs up a group of cheerleaders to help her take down the captain of their high school football team, but a supernatural turn of events thrusts the girls into a different battle they return to Sheffield for their last UK concert.', 'The Savior', '', 'inherit', 'closed', 'closed', '', '50-autosave-v1', '', '', '2019-01-17 07:03:51', '2019-01-17 07:03:51', '', 50, 'https://griyapsikologi.com/2019/01/17/50-autosave-v1/', 0, 'revision', '', 0),
