INSERT INTO `results` (`id`, `title`, `list1`, `list2`, `list3`, `list4`, `list5`, `list6`, `list7`, `list8`, `list9`, `list10`, `list11`, `list12`, `jobs`, `paragraph`) VALUES
(1, 'LOGICAL THINKER', 'Pendiam', 'Anti Kritik', 'Perfeksionis', 'Cenderung Santai', 'Detail', 'Empati', 'Rapi', 'Organized', 'Kaku pada Metode & Prosedur', ' ', ' ', ' ', 'Planner (any function), Engineer (Installation, Technical), Technical/Research (Chemist Technician), Academic, Statistician, Government Worker, IT Management, Prison Officer, Quality Controller.', 'Seorang yang praktis, cakap dan unik. Ia orang yang mampu menilai diri sendiri dan kritis terhadap dirinya dan orang lain. Ia menyukai hal yang detil dan logis; secara alamiah ia sangat analitis. Karena menyimpan informasi, ia meneliti isu berulang-ulang kali. Ia cenderung malu dan tertutup; ia hati-hati dalam membuat keputusan yang berdasarkan pada logika, bukan emosi, selalu menggunakan pertanyaan \"bagaimana dan mengapa\". Ia mengerjakan sesuatu dengan sistematis dan akurat. Ia rapi dan terorganisir sebab ia merasa bahwa keadaan berantakan sama dengan mutu yang rendah; demikian juga, rapi dan teratur merupakan mutu yang tinggi. Sangat teliti dalam segala sesuatu seperti halnya dalam pekerjaan dan penggunaan waktunya. Ia merencanakan dan mengorganisir semua sisi kehidupannya. Kelambanan sangat mengganggunya dan tak dapat ditolerir.'),
(2, 'ESTABLISHER', 'Individualis', 'Ego Tinggi, Kurang Sensitif', 'Kurang Pertimbangan', 'Efektif', 'High Motivation', 'Bersemangat Tinggi', 'Percaya Diri, Cenderung Nekat', 'Kreatif', 'Terlalu Dominan', 'Agresif', 'Terlalu Dinamis', 'Penuh Ambisi', 'Attorney, Researcher, Sales Representative, Planning Consultant, Transport Personnel, Production (Director, Manager, Supervisor), Technologist, Strategic Planning, Trouble Shooting, Marketing Services, Consultant, Engineering (Director, Manager, Supervisor) and Self-Employment.', 'Memiliki rasa ego yang tinggi dan cenderung invidualis dengan standard yang sangat tinggi. Ia lebih suka menganalisa masalah sendirian daripada bersama orang lain. Rasa egoisnya yang kuat membuatnya tidak nyaman di bawah kendali orang lain; ia lebih suka menjadi \"boss\" dan menetapkan standard tinggi baik untuk dirinya maupun orang lain. Ia menghindari sesuatu yang biasa-biasa dan cenderung mencari tantangan yang baru. Ia menyukai petualangan dan kadang-kadang beralih ke dalam petualangan baru sebelum mempertimbangkannya secara menyeluruh. Mampu memimpin situasi dan orang lain dalam rangka mencapai sasarannya; ia ingin selalu unggul dalam persaingan dengan taruhan apapun.'),
(3, 'DESIGNER', 'Sensitif', 'Kurang Cepat', 'Anti Tekanan', 'Terlalu Mandiri', 'Kurang Percaya Orang Lain', 'Anti Kritik', 'Dingin', 'Kreatif', 'Result Oriented', 'Suka Tantangan', ' ', ' ', 'Engineering (Management, Research, Design), Research (R&D), Planning, Chemist, Accountancy, Specialist, Finance, Technician, Quality Control, Production Planning/Management, Design Engineer, Bookkeeper, Chemist Technician, Safety Officer, Librarian.', 'Seorang yang sangat berorientasi pada tugas dan sensitif pada permasalahan. Ia lebih mempedulikan tugas yang ada dibanding orang-orang di sekitarnya, termasuk perasaan mereka. Sangat kukuh/keras dan mempunyai pendekatan yang efektif dalam pemecahan masalah. Oleh karena sifat alamiah dan keinginannya akan hasil yang terukur, Akan tampak dingin, tidak berperasaan dan menjaga jarak. Ia membuat keputusan berdasar pada fakta, bukan emosi. Cenderung pendiam dan tidak mudah percaya.'),
(4, 'NEGOTIATOR', 'Suka Bergaul', 'Anti Rutin', 'Aktif', 'Terlalu Percaya Diri', 'Agresif', 'Optimis', 'Kurang Detail', 'Result Oriented', ' ', ' ', ' ', ' ', 'Sales and Marketing (Directing, Manager, Person), Public Relations, Recruitment Consultant, Politician, Director, Self-Employed, Hotelier, Travel Agent, Trainer, Hospitality, Lawyer, Solicitor, Motivators, Team Leader, Politician, Trainer, Lecturer, Theatrical Agent, General Management and Leading People, Attorney.', 'Merupakan seorang pemimpin integratif yang bekerja dengan dan melalui orang lain.? Ia ramah, memiliki perhatian yang tinggi akan orang dan juga mempunyai kemampuan untuk memperoleh hormat dan penghargaan dari berbagai tipe orang.? Melakukan pekerjaannya dengan cara yang bersahabat, baik dalam mencapai sasarannya maupun meyakinkan pandangannya kepada orang lain.? Ia tidak begitu memperhatikan hal-hal kecil.? Kadang bertindak sesuai dengan kata hati/impulsif, terlalu antusias dan sangat banyak bicara.? Ia terlalu berlebihan menilai kemampuannya dalam memotivasi atau mengubah perilaku orang lain.? Mencari kebebasan dari rutinitas, menginginkan otoritas/wewenang dan juga prestise.? Ia menginginkan aktivitas yang bervariasi dan bekerja lebih efisien jika data-data analitis disediakan oleh orang lain.? Menginginkan penugasan yang mengutamakan mobilitas dan tantangan.'),
(5, 'CONFIDENT & DETERMINED', 'Pandai Memilih Orang', 'Leader', 'Good Interpersonal Skill', 'Dominan', 'Agresif', 'Perfeksionis', 'Good Communication Skill', 'Aktif', 'Need Recognition Reward', 'Kurang Peduli pada Aturan', 'Terburu-buru', ' ', 'Specialist/Technical Selling (Computer, Finance, Engineer and others, Chef, Technical/Capital Equipment Selling), Financial (Manager, Specialist), Computer Hardware Sales, Engineering (Manager, Designer, Buyer, Draughtsman), Project Engineer, Sales Engineer, Consultant, Trainer, Lecturer, Hotelier, Insurance, Mortgage and Finance Sales, Teacher, Travel Agent, Personnel and Marketing Services.', 'Sangat berorientasi terhadap tugas dan juga menyukai orang.? Ia sangat baik dalam menarik orang/recruiting.? Seorang yang bersahabat, tetapi menyukai keadaan di mana tugas-tugas harus dilakukan dengan benar.? Ia kadang-kadang tampak dingin dan mendominasi.? Ia juga bisa sangat fokus pada tugas dan melupakan orang-orang di sekitarnya.? Sangat mengharapkan orang-orang terlibat dalam proyeknya, tetapi tidak memperdulikan apa yang diinginkan oleh orang-orang itu.? Ia perlu mendengar dan memikirkan? apa yang menjadi keinginan orang di sekitarnya, khususnya kesempatan untuk mencoba.? Ia sangat membutuhkan persetujuan sosial seperti halnya ia sangat mempercayai orang lain.? Karena itu, ia kadang-kadang berlebihan dalam menilai orang dan kemampuannya.? Ia tampak tidak konsisten dan tidak karuan karena ketidakmampuannya berkonsentrasi dan fokus dalam waktu yang lama.? Perlu belajar untuk secara sungguh-sungguh mendengarkan orang-orang di sekitarnya dari pada selalu berpikir apa yang ingin dikat'),
(6, 'REFORMER', 'Mudah Bergaul', 'Leader', 'Sadar Diri', 'Butuh Pujian & Penghargaan', 'Cepat Percaya Orang', 'Mudah Simpati & Empati', 'Motivator', 'Optimis & Positif', 'Anti Aturan', 'Kurang Detail', 'Terlalu Selektif', ' ', 'Hotelier, Customer Service, Complaints Manager, Recruiting Agent, Sales (Manager/Person), Marketing Services, Public Relations, Politician, Computer Software Sales, Lecturer, Engineering and Production (Manager/Supervisor).', 'Seorang yang bersahabat dan sosial; ia juga suka mengendalikan situasi dan menjadi pemimpin.? Ia menyelesaikan tugasnya melalui keterampilan sosialnya; ia peduli dan menerima orang lain.? Ia berkonsentrasi pada tugas yang ada di tangannya sampai selesai dan akan minta bantuan orang lain jika perlu.? Ia menyadari keterbatasannya dan meminta bantuan jika memerlukannya.? Ia disukai dan orang ingin menolongnya.? Senang membagi kebanggaannya dengan kelompok; ia seorang team player tetapi juga team leader.? Menginginkan popularitas dan pengakuan.'),
(7, 'MOTIVATOR', 'Leader (Kelompok Kecil)', 'Supporter', 'Sosialisasi Baik', 'Butuh Ketegasan', 'Butuh Pujian & Penghargaan', 'Kurang Detail', 'Agak Kaku', ' ', ' ', ' ', ' ', ' ', 'Hotelier, Community Counseling, Customer Service, Complaints Manager, Community Work, Recruitment Consultant, Hospitality, Teacher, Telemarketing, Production Manager, Complaints Manager, Recruiting Agent, Sales (Manager/Person), Marketing Services, Public Relations, Politician, Call Centre Manager, Lecturer, Engineering and Production (Manager/Supervisor).', 'Seorang yang menampilkan gaya bersemangat ketika termotivasi pada sasaran.? Ia lebih suka memimpin atau melibatkan diri, walaupun ia juga mau melayani sebagai pembantu.? Ia membutuhkan pengakuan dan penghargaan serta senang pada peran pendukung. ?Ia peduli kepada orang-orang di sekitarnya dan akan mempertimbangkan perasaan orang lain dalam proses pengambilan keputusan.? Menampilkan keterampilan berhubungan dan berkomunikasi dengan sangat baik.? Ia akan berusaha keras menyelesaikan tugas dengan cepat dan efisien.'),
(8, 'INQUIRER', 'Full Self Control', 'Sabar', 'Penuh Pertimbangan', 'Good Interpersonal', 'Selektif', 'Lambat Adaptasi', 'Inisiatif Kurang', 'Result Oriented', 'Kaku dan Keras Kepala', 'Good Service', 'Kurang dalam Hal Managerial', '', 'Directing, Managing or Supervising (in Engineering, Accountancy, Research and Development and Computing disciplines), Research Manager, Scientific Work, Accountant, Administration, Project Engineer, Draughtsman, Designer, Analyst, Finance, Chemist, Technical Service Support, Flight Attendant, Technician, Service Engineer, Service Manager, Security Specialist.', 'Seorang yang sabar, terkontrol dan suka menggali fakta dan jalan keluar.? Ia tenang dan ramah.? Ia merencanakan pekerjaan dengan hati-hati, tetapi agresif, menanyakan sesuatu serta mengumpulkan data pendukung.? Kemudian ia bekerja dengan konsisten dengan arahan yang benar.? Menjadi individu yang penuh perhatian, rendah hati, dan ia berhubungan baik dengan hampir semua orang.? Seorang yang konsisten dan suka menolong. People skill darinya melebihi orientasi tugasnya.'),
(9, 'PENGAMBIL KEPUTUSAN', 'Pekerja Keras', 'Leader', 'Banyak Minat', 'Dingin / Task Oriented', 'Kurang Pergaulan', 'Kontrol Emosi Kurang', 'Suka Tantangan', 'Cepat Bosan', 'Anti Aturan', 'Kurang Detail', 'Kurang Peduli Wewenang', 'Argumentatif', 'General Management (Directing/Managing/Supervising, Public Relations, Business Management, Conflict Resolution, Industrial Relations, Business Consultant, Trouble Shooting, Sales and Sales Management, Marketing, Promoting, Production (Director, Manager, Supervisor), Consultancy, Publishing, Sales Executive, Promotional Work, Brokers, Self-Employment, Advertising, Lecturing, Dealing/Broking.', 'Tidak basa-basi dan tegas, ia cenderung merupakan seorang invidualis yang kuat. Ia berpandangan jauh ke depan, progresif dan mau berkompetisi untuk mencapai sasaran. DI seorang yang selalu ingin tahu dan mempunyai minat dengan cakupan yang luas. Ia seorang yang logis, kritis dan tajam dalam memecahkan masalah. Sering kali ia tampak imajinatif. Ia mempunyai kemampuan memimpinan yang baik. Ia kadang tampak keras kepala atau dingin karena orientasi dan prioritasnya pada tugas cenderung melebihi orientasi terhadap sesama. Ia mencanangkan standard tinggi pada dirinya dan akan sangat kritis ketika standard ini tidak dicapai. Ia juga menempatkan standard tinggi pada orang-orang di sekitarnya, serta mengutamakan kesempurnaan. Ia menginginkan otoritas yang jelas dan menyukai tugas-tugas baru.'),
(10, 'DIRECTOR', 'Pengelola', 'Enerjik', 'Kurang Detail', 'Mudah Bosan', 'Agresif', 'Arogan', 'Kurang Fokus', ' ', ' ', ' ', ' ', ' ', 'ngineering and Production (Directing, Managing, Supervising), Sales, Sales Management, Service Manager, Distribution, Public Relations, Office Management, Account Manager, Customer Service, Retail Manager, IT, Lecturer, Logistics, Manager-General, National Accounts Manager, Teacher, Projects Manager.', 'Fokus pada penyelesaian pekerjaan dan menunjukkan penghargaan yang tinggi kepada orang lain.? Ia memiliki kemampuan untuk menggerakkan orang dan pekerjaan dikarenakan keterampilannya berpikir ke depan dan hubungan antar manusia.? Tidak berorientasi detil, ia fokus pada target secara keseluruhan dengan menyerahkan hal detil kepada orang lain.? Enerjik dan sosial, ia mampu memotivasi orang lain sambil menyelesaikan pekerjaannya.? Ia menampilkan rasa percaya diri dan mampu meyakinkan orang lain.? Sekali ia memutuskan sesuatu, ia akan terus mengerjakannya dan bertahan sampai selesai.'),
(11, 'SELF-MOTIVATED', 'Objektif & Analitis', 'Mandiri', 'Good Planner', 'Komitmen Terhadap Target', 'Menghindari Konflik', ' ', ' ', ' ', ' ', ' ', ' ', ' ', 'Engineering and Production (Directing, Managing, Supervising), Project Management, Researcher, Chemist (R&D), Planner, Engineering (R&D), Systems Analyst, Commercial Planner, Computer Engineer, Programmer, IT, Other computer-related disciplines, Technical Trouble Shooting and Directing, Lawyer, Solicitor, Development Engineer, Work Study, Barrister, Attorney.', 'Seorang yang obyektif dan analitis.? Ia ingin terlibat dalam situasi, dan ia juga ingin memberikan bantuan dan dukungan kepada orang yang ia hormati.? Secara internal termotivasi oleh target pribadi, ia berorientasi terhadap pekerjaannya tapi juga menyukai hubungan dengan sesama.? Karena determinasinya yang kuat, ia sering berhasil dalam berbagai hal; karakternya yang tenang, stabil dan daya tahannya yang tinggi memiliki kontribusi dalam keberhasilannya.? Ulet dalam memulai pekerjaan. Ia akan berusaha keras untuk mencapai sasarannya.? Seorang yang mandiri dan cermat serta memiliki tindak lanjut yang baik.'),
(12, 'MEDIATOR', 'Loyal', 'Tight Scheduled', 'Curious', 'Sensitif', 'Good Communication Skill', 'Good Analitical Think', 'Good Interpersonal Skill', 'Cepat Beradaptasi', 'Anti Kritik', 'Not Leader', 'Work/Play Conflict', ' ', 'Engineering and Production (Supervisor, Installer, Technician, Service and Design), Research (Supervisor, Chemist, Lab. Technician), Trainer, Finance (Supervisor, Accountant, Advisor), Public Relations, Administration, Office Administrator, Market Analyst, System Analyst, Programmer, Selling (Technical/Service).', 'Merupakan individu yang berorientasi pada orang, ia mampu menggabungkan ketepatan dan loyalitas.? Ia cenderung peka dan mempunyai standard yang tinggi.? Ia menginginkan stabilitas dan berorientasi terhadap sasaran.? Ia menginginkan pengakuan sosial dan perhatian pribadi.? Ia bersahabat, antusias, informal, banyak bicara, dan mungkin sangat mencemaskan apa yang dipikirkan oleh orang lain.? Ia menolak agresi, dan mengharapkan suasana harmonis.? Ia cenderung cukup cerdas dalam berbagai hal. Ia merupakan pencari fakta yang sangat baik dan akan membuat keputusan yang baik setelah mengumpulkan fakta dan data pendukung.'),
(13, 'PRACTITIONER', 'Perfeksionis', 'Quality Oriented', 'Scheduled', 'Anti Kejutan', 'Good Interpersonal', 'Terlalu Detail', 'Sistematis', 'Kaku / Tidak Fleksibel', 'Monoton', ' ', ' ', ' ', 'Engineering and Production (Supervisor, Installer, Technician, Service and Design), Research (Supervisor, Chemist), Trainer, Finance (Manager, Supervisor, Accountant, Advisor), Public Relations-Administration, Purchasing, Chemist Research, Office Administrator, Computer Programmer, Market Analyst, System Analyst, Programmer, Research and Development Supervisor, Laboratory Technician, Legal, Selling (Technical/Service).', 'Merupakan individu yang berorientasi pada orang, ia mampu menggabungkan ketepatan dan loyalitas.? Ia cenderung peka dan mempunyai standard yang tinggi.? Ia menginginkan stabilitas dan berorientasi terhadap sasaran.? Ia menginginkan pengakuan sosial dan perhatian pribadi.? Bersahabat, antusias, informal, banyak bicara, dan mungkin sangat mencemaskan apa yang dipikirkan oleh orang lain.? Ia menolak agresi dan mengharapkan suasana harmonis.? Ia cenderung cukup cerdas dalam berbagai hal. Ia merupakan pencari fakta yang sangat baik dan akan membuat keputusan yang baik setelah mengumpulkan fakta dan data pendukung.'),
(14, 'RESPONSIVE & THOUGHTFUL', 'High Energy', 'Good Communication Skill', 'To The Point', 'Sensitif', 'Banyak Bicara', 'Need Recongnition', 'Need Socialism', 'Anti Terhadap Kritik', 'Terlalu Banyak Bersosialisasi', 'Leadership Kurang', 'Kurang Fokus', 'Anti Deadline', 'Actors, Chef, Personnel, Welfare, Broadcasting, Training, Attorney, Teaching, Accounting, Technical Instructor, Accounting-General, Accounts Supervisor, Customer Services, Public Relations, Artist, Hotelier, Demonstrator, Florist/Floral Designer, Engineering (Sales, Service, Project, Draughtsman, Designer), Graphic Designer, Specialist (Soft/Services), Selling, Purchasing, Singers, Technical Instructor, Personnel Management, Politician, Supervising (Engineering, Production, Accounts), Administration Work, Sales Engineer, Secretarial, Industrial Relations Specialist.', 'Merupakan individu yang berorientasi pada orang dan lancar berkomunikasi serta loyal.? Ia cenderung sensitif dan mempunyai standard yang tinggi.? Keputusannya dibuat berdasarkan fakta dan data pendukung.? Ia sepertinya tidak bisa diam.? Ia perlu untuk lebih terus terang dan jangan terlalu subyektif.? Ia butuh pengakuan sosial dan perhatian pribadi; ia dapat cepat akrab dengan orang lain.? Ia bersahabat, antusias, informal, banyak bicara dan terlalu khawatir terhadap apa yang dipikirkan orang.? Ia menguasai banyak hal.? Ia ingin diterima sebagai anggota kelompok dan ingin mengetahui secara pasti apa yang diharapkan darinya sebelum ia memulai proyek baru.'),
(15, 'SPECIALIST', 'Stabil & Konsisten', 'Terkendali', 'Nyaman di Belakang Layar', 'Sabar', 'Loyal', 'Sulit Adaptasi', 'Process Oriented', 'Teguh', 'Need for Peace', 'Anti Perubahan', 'Sulit Menentukan Prioritas', ' ', 'Administrative Work, Engineering and Production areas (Sales, Services, Project, Painter, Plumber, Draughtsman, Designer, Operative), Chef, Accounting, Telemarketing/Tele-Sales, Research and Development, Administrator, Florist/Floral Designer, Retail-General, Sales-General, Accounting-General, Service-General, Landscape Gardener.', 'Merupakan individu konsisten yang berusaha menjaga lingkungan/suasana yang tidak berubah.? Ia bekerja dengan baik bersama orang-orang dengan berbagai kepribadian karena perilakunya yang terkendali dan rendah hati.? Sabar, loyal dan suka menolong.? Persahabatan dikembangkannya dengan lambat dan selektif.? Ia tidak bosan dengan rutinitas dan sangat baik bekerja dengan petunjuk dan peraturan yang jelas. Ia mengharapkan bantuan dan supervisi pada saat mengawali proyek baru.? Ia butuh waktu untuk menyesuaikan diri dengan perubahan dan sungkan menjalankan \"cara-cara lama mengerjakan sesuatu\".? Ia akan menghindari konfrontasi dan berusaha sekuat tenaga memendam perasaannya.'),
(16, 'PERFECTIONIST', 'Detail & Teliti', 'Butuh Situasi Stabil', 'Sistematik & Prosedural', 'Menghindari Konflik', 'Anti Kritik', 'Lambat Memutuskan', 'Sulit Adaptasi', 'Pendendam', 'Anti Perubahan', ' ', ' ', ' ', 'Researcher (Technician, Chemist, Quality Control), Engineer (Project, Draughtsman, Armed Forces, Designer), Statistician, Surveyor, Optician, Medical Specialist, Health Care, IT Management, Planner, Technical Writing, Production, Dentist, Quality Control, Planning, Dental Technician, Accounting, Computer Programmer, Psychologist, Surgeon, Architect, Medical Specialist.', 'Berpikir sistematis dan cenderung mengikuti prosedur dalam kehidupan pribadi dan pekerjaannya.? Teratur dan memiliki perencanaan yang baik, ia teliti dan fokus pada detil.? Bertindak dengan penuh kebijaksanaan, diplomatis dan jarang menentang rekan kerjanya dengan sengaja.? Ia sangat berhati-hati, sungguh-sungguh mengharapkan akurasi dan standard tinggi dalam pekerjaannya.? Ia cenderung terjebak dalam hal detil, khususnya jika harus memutuskan.? Menginginkan adanya petunjuk standard pelaksanaan kerja dan tanpa perubahan mendadak.'),
(17, 'PEACEMAKER, RESPECTFUL & ACCURATE', 'Sulit Beradaptasi', 'Anti Kritik', 'Pendendam', 'Sukar Berubah', 'Detail', 'Empati', 'Memikirkan Dampak ke Orang Lain', 'Terlalu Mendalam dalam Berpikir', 'Concern ke Data dan Fakta', 'Introvert', 'Loyal', ' ', 'Office (Manager, Supervisor, Person), Chief Clerk, General Administrator, Production Supervisor, Planner, Accountant, Research and Development, Flight Attendant, Engineering (Project Manager, Supervisor, Technician), Computer Programmer, Draughtsman, Soft/Service Selling, Doctor, Cashier, Receptionist, Data Entry, Planner, Word Processing, Property Manager, Database Administrator, Health Care, Statistician, Nursing-Administration, Company Secretary, System Analyst, Programmer, Statistician, Accounting-General, Security Specialist.', 'Ia adalah orang yang baik secara alamiah dan sangat berorientasi detil.? Ia peduli dengan orang-orang di sekitarnya dan mempunyai kualitas yang membuatnya sangat teliti dalam penyelesaian tugas.? Ia mempertimbangkan sekelilingnya dengan hati-hati sebelum membuat keputusan untuk melihat pengaruhnya pada mereka; saat tertentu ia terlalu hati-hati.? Jika ia merasa seseorang memanfaatkan situasi, ia akan memperlambat kerjanya sehingga dapat mengamati apa yang sedang berlangsung di sekitarnya.'),
(18, 'CHALLENGER', 'Seorang yang Tekun', 'Sensitif Terhadap Permasalahan', 'Mempunyai Keputusan yang Kuat', 'Kreatif dalam Memecahkan Masalah', 'Memiliki Reaksi yang Cepat', 'Mampu Mencari Solusi Permasalahan', 'Banyak Memberikan Ide - Ide', 'Usaha yang Keras pada Ketepatan', 'Cenderung Perfeksionis', ' ', ' ', ' ', 'Engineering (Management, Research, Design), Actuaries, Research (R&D), Planning, Chemist, Hospital Supervisor, Industrial Marketing, Investment Banking, Medical Administrator, Mortgage Brokers, Accountancy, Fund Management, Specialist Finance, Quality Control and Specialist work in any area where knowledge and experience is available, Production, Financial Services, Technical Management, Project Leader, Matron, Strategic Planning, Industrial Marketing.', 'Seorang yang sensitif terhadap permasalahan, dan memiliki kreativitas yang baik dalam memecahkan masalah. Ia dapat menyelesaikan tugas-tugas penting dalam waktu singkat karena mempunyai keputusan yang kuat. Seorang yang tekun dan memiliki reaksi yang cepat.? Ia akan meneliti dan mengejar semua kemungkinan yang ada dalam mencari solusi permasalahan.? Ia banyak memberikan ide-ide dengan berfokus pada pekerjaan. Usaha yang keras pada ketepatan akan mengimbangi keinginannya pada hasil yang terukur.? Ia cenderung perfeksionis dan dapat juga memperlambat pengambilan keputusan karena keinginannya untuk menentukan pilihan yang terbaik.'),
(19, 'CHANCELLOR', 'Seorang yang Ramah Secara Alami', 'Menggabungkan Kesenangan dengan Pekerjaan', 'Menyukai Hubungan dengan Sesama', 'Menikmati Interaksi Dengan Sesama', 'Dapat Mengerjakan Hal - Hal Detil', 'Ingin Melakukan Segala Sesuatu dengan Tepat', 'Menilai Orang dan Tugas Secara Hati - Hati', 'Sering Melalaikan Perencanaan yang Seksama', 'Mudah Beralih kepada Proyek - Proyek Baru', ' ', ' ', ' ', 'Technical/Scientific (Directing, Management, Supervision), Engineering, Finance, Production Planning, Personnel Disciplines, Self-Employment, Credit Manager, Planner, Fund Management, Computer Hardware/Software Sales, IT, Business Consultant, Banking, Logistics, Lecturing, Work Study, Film Director, Transport, Consultancy, Industrial Relations and Computers (Selling, Software, Systems Analyst) and General Manager.', 'Ia menggabungkan antara kesenangan dengan pekerjaan/bisnis ketika melakukan sesuatu. Ia kelihatan menyukai hubungan dengan sesama tetapi juga dapat mengerjakan hal-hal detil. Ia ingin melakukan segala sesuatu dengan tepat, dan ia akan menyelesaikan tugasnya untuk meyakinkan ketepatan dan kelengkapannya. Seorang yang ramah secara alami dan menikmati interaksi dengan sesama, akan tetapi ia akan juga menilai orang dan tugas secara hati-hati; persahabatannya akan bergeser sesuai dengan dorongan hatinya pada orang lain di sekitarnya. Ia sering melalaikan perencanaan yang seksama dan akan beralih ke pada proyek-proyek baru tanpa pertimbangan yang menyeluruh.'),
