(25, 'ADVISOR', 'Hangat', 'Simpati', 'Tenang dalam Situasi Sosial', 'Pendengar yang Baik', 'Demonstratif', 'Tidak Memaksakan Idenya pada Orang Lain', 'Kurang tegas dalam memberi perintah', 'Menerima kritik', 'Toleran dan sabar', 'Penjaga damai', ' ', ' ', 'Personnel, Welfare, Training, Hotelier, Promoting, Travel Agent, Lecturing, Upmarket/Speciality Sales, Soft/Service Selling, Beauty Therapist, Psychologist, Nursing, Human Resources, Retail-Specialist, Veterinarian, Social Work, Personal Assistant, Personnel-HR, Coach, Mentor.', 'Seorang yang mengesankan orang akan kehangatan, simpati dan pengertiannya.? Ia memiliki ketenangan dalam sebagian besar situasi sosial dan jarang tidak menyenangkan orang lain.? Faktanya, banyak orang datang padanya karena ia kelihatan sebagai pendengar yang baik.? Ia cenderung sangat demonstratif dan emosinya biasanya tampak jelas bagi orang di sekitarnya.? Ia tidak akan memaksakan idenya pada orang lain; ia tidak tegas dalam mengekspresikan atau memberi perintah.? Jika ia sangat kuat merasakan sesuatu, Ia akan bicara secara terbuka dan terus terang tentang pendiriannya.? Ia cenderung menerima kritik atas pekerjaannya sebagai serangan pribadi.? Ia dapat menjadi sangat toleran dan sabar kepada mereka yang tidak produktif di pekerjaan.? Ia merupakan \"penjaga damai\" dan akan bekerja untuk menjaga kedamaian dalam setiap keadaan.'),
(26, 'ASSESSOR', 'Ramah', 'Suka berteman', 'Nyaman walapun dengan orang asing', 'Mudah mengembangkan hubungan baru', 'Dapat mengendalikan diri', 'Sangat sosial', 'Cenderung perfeksionis alamiah', 'Mempromosikan tugas-tugas orang lain', ' ', ' ', ' ', ' ', 'Teaching, Training, Inventing, Specialist Selling (Engineering, Finance or any area involving capital equipment), Project Engineer, Finance, Service Engineer or Supervising within a Technical/Specialist Area, Public Relations, Environmentalist, Marketing, Conference Organiser, Estate Agent.', 'Merupakan seorang yang ramah dan suka berteman; ia merasa nyaman walaupun dengan orang asing. Ia dapat mengembangkan hubungan baru dengan mudah, dan pada umumnya dapat mengendalikan diri sampai pada tingkat dimana ia jarang menimbulkan rasa benci pada orang lain dengan sengaja. Ia seorang yang sangat sosial, menunjukkan kepedulian dan persahabatan ketika sedang melakukan tugas-tugas di tangannya. Ia cenderung perfeksionis secara alamiah, dan akan mengisolasi dirinya jika diperlukan untuk melaksanakan pekerjaan.? Ia berkeinginan mempromosikan tugas-tugas orang lain, juga kepunyaannya.? Kadang-kadang ia salah menilai kemampuan orang lain dikarenakan pandangan-pandangannya yang optimis.'),
(27, 'ASSESSOR', 'Analitis', 'Berwatak hati-hati', 'Sangat biasa dengan orang asing', 'Mudah mengembangkan hubungan baru', 'Dapat mengendalikan diri', 'Peduli dan ramah', 'Memusatkan perhatian pada penyelesaian tugas', 'Perfeksionis secara alami', 'Mengisolasi dirinya jika diperlukan', 'Mudah diramalkan', 'Berorientasi pada kualitas', 'Ramah pada saat merasa nyaman', 'Specialist/Technical Selling (Computer, Finance, Engineer and others, Technical/Capital Equipment Selling), Financial (Manager, Specialist), Engineering (Manager, Designer, Buyer, Draughtsman), Project Engineer, Sales Engineer, Consultant, Trainer, Lecturer, Hotelier, Travel Agent, Personnel and Marketing Services.', 'Merupakan seseorang yang analitis, berwatak hati-hati dan ramah pada saat merasa nyaman. Ia sangat biasa dengan orang asing, karena ia dapat menilai dan menyesuaikan diri dalam hubungan mereka. Ia dapat mengembangkan hubungan baru dengan mudah ketika ia ingin melakukannya, dan pada umumnya dapat mengendalikan diri sampai pada tingkat di mana ia jarang menimbulkan rasa benci pada orang lain dengan sengaja. Ia menampilkan sikap peduli dan ramah, namun mampu memusatkan perhatian pada penyelesaian tugas yang ada. Ia cenderung perfeksionis secara alami, dan akan mengisolasi dirinya jika diperlukan untuk melaksanakan pekerjaan. Ia suka berada pada situasi yang dapat diramalkan dan tidak ada kejutan. Ia sangat berorientasi pada kualitas dan akan bekerja dengan keras untuk menyelesaikan pekerjakan dengan benar. Ia ingin orang-orang berkenan akan pekerjaan yang sudah ia selesaikan dengan baik.'),
(28, 'RESPONSIVE & THOUGHTFUL', 'High Energy', 'Good Communication Skill', 'To The Point', 'Sensitif', 'Kurang Fokus', 'Banyak Bicara', 'Need Recognition', 'Need Socialism', 'Anti terhadap Kritik', 'Terlalu banyak bersosialisasi', 'Leadership kurang', 'Anti Deadline', 'Personnel, Welfare, Training, Attorney, Teaching, Accounting, Technical Instructor, Customer Services, Public Relations, Artist, Hotelier, Demonstrator, Engineering (Sales, Service, Project, Draughtsman, Designer), Specialist (Soft/Services), Selling, Purchasing, Supervising (Engineering, Production, Accounts), Administration Work, Secretarial, Industrial Relations Specialist.', 'Merupakan individu yang berorientasi pada orang dan lancar berkomunikasi serta loyal.? Ia cenderung sensitif dan mempunyai standard yang tinggi.? Keputusannya dibuat berdasarkan fakta dan data pendukung.? Ia sepertinya tidak bisa diam.? Ia perlu untuk lebih terus terang dan jangan terlalu subyektif.? Ia butuh pengakuan sosial dan perhatian pribadi; ia dapat cepat akrab dengan orang lain.? Ia bersahabat, antusias, informal, banyak bicara dan terlalu khawatir terhadap apa yang dipikirkan orang.? Ia menguasai banyak hal.? Ia ingin diterima sebagai anggota kelompok dan ingin mengetahui secara pasti apa yang diharapkan darinya sebelum ia memulai proyek baru.'),
