(30, 'ADVISOR', 'Hangat', 'Simpati dan Pengertian', 'Tenang dalam situasi sosial', 'Pendengar yang baik', 'Demonstratif', 'Tidak memaksakan idenya pada orang lain', 'Kurang tegas dalam memberi perintah', 'Menerima kritik', 'Toleran dan sabar', 'Penjaga damai', ' ', ' ', 'Personnel Welfare, Training, Hotelier, Promoting, Travel Agent, Lecturing, Child Care, Charitable Organizations, Soft or Service Selling, Psychologist, Therapist, Nurse, Personal Assistant, Hospitality Manager, Social Work, Student Services, Upmarket/Speciality Sales.', 'Seorang yang mengesankan orang akan kehangatan, simpati dan pengertiannya.? Ia memiliki ketenangan dalam sebagian besar situasi sosial dan jarang tidak menyenangkan orang lain.? Faktanya, banyak orang datang padanya karena ia kelihatan sebagai pendengar yang baik.? Ia cenderung sangat demonstratif dan emosinya biasanya tampak jelas bagi orang di sekitarnya.? Ia tidak akan memaksakan idenya pada orang lain; ia tidak tegas dalam mengekspresikan atau memberi perintah.? Jika ia sangat kuat merasakan sesuatu, Ia akan bicara secara terbuka dan terus terang tentang pendiriannya.? Ia cenderung menerima kritik atas pekerjaannya sebagai serangan pribadi.? Ia dapat menjadi sangat toleran dan sabar kepada mereka yang tidak produktif di pekerjaan.? Ia merupakan \"penjaga damai\" yang sebenarnya dan akan bekerja untuk menjaga kedamaian dalam setiap keadaan.'),
