(32, 'DIRECTOR', 'Hangat', 'Simpati dan Pengertian', 'Tenang dalam situasi sosial', 'Pendengar yang baik', 'Demonstratif', 'Tidak memaksakan idenya pada orang lain', 'Kurang tegas dalam memberi perintah', 'Menerima kritik', 'Toleran dan sabar', 'Penjaga damai', ' ', ' ', 'Engineering and Production (Supervision), Service Selling, Distribution and Warehouse Supervision, Office Management, Customer Service, System Analyst, Programmer, Sales/Service Engineer, Accounting, Draughtsman, Project Engineer.', 'Seorang yang mengesankan orang akan kehangatan, simpati dan pengertiannya.? Ia memiliki ketenangan dalam sebagian besar situasi sosial dan jarang tidak menyenangkan orang lain.? Faktanya, banyak orang datang padanya karena ia kelihatan sebagai pendengar yang baik.? Ia cenderung sangat demonstratif dan emosinya biasanya tampak jelas bagi orang di sekitarnya.? Ia tidak akan memaksakan idenya pada orang lain; ia tidak tegas dalam mengekspresikan atau memberi perintah.? Jika ia sangat kuat merasakan sesuatu, Ia akan bicara secara terbuka dan terus terang tentang pendiriannya.? Ia cenderung menerima kritik atas pekerjaannya sebagai serangan pribadi.? Ia dapat menjadi sangat toleran dan sabar kepada mereka yang tidak produktif di pekerjaan.? Ia merupakan \"penjaga damai\" yang sebenarnya dan akan bekerja untuk menjaga kedamaian dalam setiap keadaan.'),
(33, 'ADVOCATE', 'Stabil', 'Ramah', 'Detail ketika situasi membutuhkan', 'Cenderung individualis', 'Teguh pendirian', 'Menyukai hubungan dengan orang', 'Mendukung pihak yang lemah', 'Ingin diterima sebagai anggota tim', 'Ingin orang lain menyukainya', 'Sulit membuat keputusan', 'Moderat', 'Cermat dan dapat diandalkan', 'Personnel Welfare, Training, Teaching, Attorney, Accounting, Technical Instructor, Customer Service, Public Relations, Artist, Hotelier, Demonstrator, Engineer (Sales, Service, Project, Draughtsman, Designer), Specialist (Soft/Service), Selling, Purchasing, Supervising (Engineering, Production, Accounts) Administrative Work, Secretarial.', 'Merupakan orang yang stabil, individu yang ramah yang berusaha keras membangun hubungan yang positif di tempat kerja dan di rumah.? Ia dapat menjadi sangat berorientasi detil ketika situasi membutuhkan; tetapi secara keseluruhan ia cenderung individualis, independen dan sedikit perhatian terhadap detil.? Sekali dia membuat keputusan, sangat sulit mengubah pendiriannya.? Ia menyukai hubungan dengan orang dan cenderung mendukung pihak yang lemah.? Ia akan mengambil posisi berlawanan dengan ketidaksepakatan dan merasa frustrasi jika sesuatu tidak sejalan dengannya.? Ia ingin diterima sebagai anggota tim, dan ia menginginkan orang lain menyukainya.? Ia cukup sulit membuat keputusan sampai parameter wewenang secara jelas ditentukan, dan ia mungkin cenderung tidak sungguh-sungguh jika dipaksa membuat keputusan ketika ia tidak ingin melakukannya.? Ia menginginkan orang lain yang membuat keputusan, khususnya jika ada orang yang sangat ia hargai dan hormati.? Ia cenderung moderat, cermat dan dapat diandalkan.'),
(34, 'INQUIRER', 'Seorang yang baik', 'Sangat berorientasi pada detil', 'Sangat teliti dalam penyelesaian tugas', 'Sangat berhati-hati', 'Penuh pertimbangan', 'Lambat adaptasi', 'Kaku dan keras kepala', ' ', ' ', ' ', ' ', ' ', 'Directing, Managing or Supervising (in Engineering, Accountancy, Research and Development and Computing disciplines), Accountant, Project Engineer, Draughtsman, Designer, Analyst, Chemist, Technician, Service Engineer, Manager, Security Specialist.', 'Seorang yang baik secara alamiah dan sangat berorientasi detil.? Ia peduli dengan orang-orang di sekitarnya dan mempunyai kualitas yang membuatnya sangat teliti dalam penyelesaian tugas.? Ia mempertimbangkan sekelilingnya dengan hati-hati sebelum membuat keputusan untuk melihat pengaruhnya pada mereka; saat tertentu ia terlalu hati-hati.? Jika ia merasa seseorang memanfaatkan situasi, ia akan memperlambat kerjanya sehingga dapat mengamati apa yang sedang berlangsung di sekitarnya.'),
(35, 'INQUIRER', 'Teguh pendirian', 'Stabil', 'Ramah', 'Detail ketika situasi membutuhkan', 'Cenderung individualis', 'Menyukai hubungan dengan orang', 'Mendukung pihak yang lemah', 'Ingin diterima sebagai anggota tim', 'Ingin orang lain menyukainya', 'Sulit membuat keputusan', 'Moderat', 'Cermat dan dapat diandalkan', 'Personnel Welfare, Administrator, Advisers, Training, Teaching, Attorney, Accounting, Counseling, Technical Instructor, Customer Service, Accounting-General, Public Relations, Accounts Supervisor, Artist, Hotelier, Demonstrator, Engineer (Sales, Service, Project, Draughtsman, Designer), Specialist (Soft/Service), Selling, Purchasing, Sales Engineer, Legal, Negotiator, Student Service, Photographer, Physiotherapist, Project Engineer, Vocational Education, Supervising (Engineering, Production, Accounts) Administrative Work, Demonstrator, Secretarial, Hospitality Manager.', 'Merupakan orang yang stabil, individu yang ramah yang berusaha keras membangun hubungan yang positif di tempat kerja dan di rumah.? Ia dapat menjadi sangat berorientasi detil ketika situasi membutuhkan; tetapi secara keseluruhan ia cenderung individualis, independen dan sedikit perhatian terhadap detil.? Sekali dia membuat keputusan, sangat sulit mengubah pendiriannya.? Ia menyukai hubungan dengan orang dan cenderung mendukung pihak yang lemah.? Ia akan mengambil posisi berlawanan dengan ketidaksepakatan dan merasa frustrasi jika sesuatu tidak sejalan dengannya.? Ia ingin diterima sebagai anggota tim, dan ia menginginkan orang lain menyukainya.? Ia cukup sulit membuat keputusan sampai parameter wewenang secara jelas ditentukan, dan ia mungkin cenderung tidak sungguh-sungguh jika dipaksa membuat keputusan ketika ia tidak ingin melakukannya.? Ia menginginkan orang lain yang membuat keputusan, khususnya jika ada orang yang sangat ia hargai dan hormati.? Ia cenderung moderat, cermat dan dapat diandalkan.'),
(36, 'ASSESSOR', 'Analitis', 'Berwatak hati-hati', 'Ramah pada saat merasa nyaman', 'Sangat biasa dengan orang asing', 'Mudah mengembangkan hubungan baru', 'Dapat mengendalikan diri', 'Peduli dan ramah', 'Memusatkan perhatian pada penyelesaian tugas', 'Perfeksionis secara alami', 'Mengisolasi dirinya jika diperlukan', 'Mudah diramalkan', 'Berorientasi pada kualitas', 'Sales (Technical/Specialist), Public Relations, Lecturer, Academic, Personnel Administration, Purchasing, Travel Agent, Training, Teaching, Real Estate Agent, Hospitality Administration, Sales-Technical, Hotelier, Project Engineer, Service Engineer.', 'Merupakan seseorang yang analitis, berwatak hati-hati dan ramah pada saat merasa nyaman. Ia sangat biasa dengan orang asing, karena ia dapat menilai dan menyesuaikan diri dalam hubungan mereka. Ia dapat mengembangkan hubungan baru dengan mudah ketika ia ingin melakukannya, dan pada umumnya dapat mengendalikan diri sampai pada tingkat di mana ia jarang menimbulkan rasa benci pada orang lain dengan sengaja. Ia menampilkan sikap peduli dan ramah, namun mampu memusatkan perhatian pada penyelesaian tugas yang ada. Ia cenderung perfeksionis secara alami, dan akan mengisolasi dirinya jika diperlukan untuk melaksanakan pekerjaan. Ia suka berada pada situasi yang dapat diramalkan dan tidak ada kejutan. Ia sangat berorientasi pada kualitas dan akan bekerja dengan keras untuk menyelesaikan pekerjakan dengan benar. Ia ingin orang-orang berkenan akan pekerjaan yang sudah ia selesaikan dengan baik.'),
(37, 'CHALLENGER', 'Sangat berorientasi pada tugas', 'Sensitif terhadap permasalahan', 'Lebih mempedulikan tugas daripada orang', 'Kukuh/keras', 'Dingin', 'Tidak berperasaan', 'Menjaga jarak', 'Membuat keputusan berdasarkan fakta', 'Pendiam', 'Tidak mudah percaya', ' ', ' ', 'Directing, Managing or Supervising (Engineering, Research, Finance, Planning), Designer, Work Study, Sales (Technical/ Specialist), Logistic Support, Systems Analyst, Lecturer, Company Secretary, Negotiator and Purchasing.', 'Seorang yang sangat berorientasi pada tugas dan sensitif pada permasalahan. Ia lebih mempedulikan tugas yang ada dibanding orang-orang di sekitarnya, termasuk perasaan mereka. Ia sangat kukuh/keras dan mempunyai pendekatan yang efektif dalam pemecahan masalah. Oleh karena sifat alamiah dan keinginannya akan hasil yang terukur, ia akan tampak dingin, tidak berperasaan dan menjaga jarak. Ia membuat keputusan berdasar pada fakta, bukan emosi. ia cenderung pendiam dan tidak mudah percaya.');
