(38, 'CONTEMPLATOR', 'Berorientasi pada hal-hal detil', 'Mempunyai standar tinggi untuk dirinya', 'Logis dan analitis', 'Ingin berbuat yang terbaik', 'Selalu berpikir ada ruang untuk kemajuan', 'Kompetitif', 'Ingin menghasilkan mutu yang terbaik', 'Mampu mencapai sasarannya', 'Sangat memusatkan perhatian pada tugas', 'Mantap dan dapat diandalkan', ' ', ' ', 'Engineering, Research, Production and Finance (Director, Manager atau Supervisor), Work Study, Accountant, Administrator, Quality Controller, Safety Officer, Market Analyst, Planner and Personnel (Director, Manager, Administrator), MIS Manager, Security Manager, Loss Control.', 'Berorientasi pada hal detil dan mempunyai standard tinggi untuk dirinya. Ia logis dan analitis. Ia ingin berbuat yang terbaik, dan ia selalu berpikir ada ruang untuk peningkatan/kemajuan. Ia cenderung kompetitif dan ingin menghasilkan pekerjaan dengan mutu yang terbaik. Ia sebenarnya sensitif terhadap orang-orang, tetapi karena sifat logisnya, orientasinya terhadap tugas dapat menutupinya dengan mudah. Ia suka dihargai untuk pekerjaannya yang berkualitas. Ia mampu mengerjakan tugas-tugas; dan mencapai sasarannya. Ia sangat memusatkan perhatian pada tugas yang ada, mantap dan dapat diandalkan.'),
(39, 'ASSESSOR', 'Analitis', 'Berwatak hati-hati', 'Ramah pada saat merasa nyaman', 'Sangat biasa dengan orang asing', 'Selalu berpikir ada ruang untuk kemajuanMudah meng', 'Dapat mengendalikan diri', 'Peduli dan ramah', 'Memusatkan perhatian pada penyelesaian tugas', 'Perfeksionis secara alami', 'Mengisolasi dirinya jika diperlukan', 'Mudah diramalkan', 'Berorientasi pada kualitas', 'Directing, Managing or Supervising (Engineering, Research, Finance, Planning), Designer, Work Study, Sales (Technical/Specialist), Lecturer, Company Secretary, Negotiator and Purchasing.', 'Merupakan seseorang yang analitis, berwatak hati-hati dan ramah pada saat merasa nyaman. Ia sangat biasa dengan orang asing, karena ia dapat menilai dan menyesuaikan diri dalam hubungan mereka. Ia dapat mengembangkan hubungan baru dengan mudah ketika ia ingin melakukannya, dan pada umumnya dapat mengendalikan diri sampai pada tingkat di mana ia jarang menimbulkan rasa benci pada orang lain dengan sengaja. Ia menampilkan sikap peduli dan ramah, namun mampu memusatkan perhatian pada penyelesaian tugas yang ada. Ia cenderung perfeksionis secara alami, dan akan mengisolasi dirinya jika diperlukan untuk melaksanakan pekerjaan. Ia suka berada pada situasi yang dapat diramalkan dan tidak ada kejutan. Ia sangat berorientasi pada kualitas dan akan bekerja dengan keras untuk menyelesaikan pekerjakan dengan benar. Ia ingin orang-orang berkenan akan pekerjaan yang sudah ia selesaikan dengan baik.'),
(40, 'PRECISIONIST', 'Sistematis dan Prosedural', 'Teratur & memiliki perencanaan yang baik', 'Teliti', 'Fokus pada detil', 'Bijaksana', 'Diplomatis', 'Jarang menentang rekan kerjanya', 'Ia sangat berhati-hati', 'Mengharapkan akurasi dan standard tinggi', 'Menginginkan adanya petunjuk standard', 'Tidak menginginkan perubahan mendadak', ' ', 'Engineering, Research Director, Production and Finance (Director, Manager, Supervisor), Work Study, Accountant, Administrator, Quality Controller, Financial Services Manager, Safety Officer, Market Analyst, Planner and Personnel (Director, Manager, Administrator), MIS Manager, Electrician, Security Manager, Financial Researcher, Planner, Printer, Production Controller, Production Manager, Personnel Management, Loss Control.', 'Berpikir sistematis dan cenderung mengikuti prosedur dalam kehidupan pribadi dan pekerjaannya.? Teratur dan memiliki perencanaan yang baik, ia teliti dan fokus pada detil.? Ia bertindak dengan penuh kebijaksanaan, diplomatis dan jarang menentang rekan kerjanya dengan sengaja.? Ia sangat berhati-hati, ia sungguh-sungguh mengharapkan akurasi dan standard tinggi dalam pekerjaannya.? Ia cenderung terjebak dalam hal detil, khususnya jika harus memutuskan.? ia menginginkan adanya petunjuk standard pelaksanaan kerja dan tanpa perubahan mendadak.');
